tables.table_schema:
CREATE TABLE land_use_regulations (
  id INT PRIMARY KEY,
  zone_id INT,
  land_use_type VARCHAR(50),
  restrictions TEXT
);

CREATE TABLE zoning_districts (
  zone_id INT PRIMARY KEY,
  district_name VARCHAR(50),
  total_area DECIMAL,
  residential_density INT
);

CREATE TABLE land_use_zones (
    zone_id INT PRIMARY KEY,
    zone_name VARCHAR(255),
    zone_description TEXT
);

CREATE TABLE zoning_restrictions (
    restriction_id INT PRIMARY KEY,
    restriction_type VARCHAR(50),
    restriction_description TEXT
);

CREATE TABLE zoning_regulations (
    ID SERIAL PRIMARY KEY,
    zone_name VARCHAR(50) NOT NULL,
    building_height INTEGER,
    setback_distance INTEGER
);

CREATE TABLE land_use_categories (
    ID SERIAL PRIMARY KEY,
    category_name VARCHAR(50) NOT NULL,
    description TEXT
);

CREATE TABLE permitted_uses (
    ID SERIAL PRIMARY KEY,
    land_use_category_id INTEGER NOT NULL,
    zone_id INTEGER NOT NULL,
    PRIMARY KEY (land_use_category_id, zone_id)
);

CREATE TABLE parcel_information (
    parcel_id INT PRIMARY KEY,
    parcel_size DECIMAL(10,2),
    zone_id INT,
    FOREIGN KEY (zone_id) REFERENCES zoning_regulations(id)
);
